import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import Home from './components/Home.js';
import Frontend from './components/Frontend.js';
import Frameworks from './components/Frameworks.js';
import Databases from './components/Databases.js';
import Hosting from './components/Hosting.js';
import Login from './components/Login.js';
import Signup from './components/Signup.js';
import Logout from './components/Logout.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component{
    render() {
        return (
            <Router>
                <div className="container-fluid Main1">
                    <nav className="dropdown">
                        <Link to="/">My Dev Corner</Link>
                        <Link to="/languages" className="dropdown-toggle">Front-End</Link>
                            <div className="dropdown-menu">

                            </div>

                        <Link to="/cssframeworks">Back-End</Link>
                        <Link to="/hosting">Hosting</Link>
                        <Link to="/databases">Databases</Link>
                        <Link to="/signup">Sign Up</Link>
                        <Link to="/login">Login</Link>
                        <Link to="/logout">Log Out</Link>
                    </nav>
                    <Switch>
                        <Route exact path="/">
                            <Home/>
                        </Route>
                        <Route path="/frontend">
                            <Frontend/>
                        </Route>
                        <Route path="/cssframeworks">
                            <Frameworks/>
                        </Route>
                        <Route path="/databases">
                            <Databases/>
                        </Route>
                        <Route path="/hosting">
                            <Hosting/>
                        </Route>
                        <Route path="/signup">
                            <Signup/>
                        </Route>
                        <Route path="/login">
                            <Login/>
                        </Route>
                        <Route path="/logout">
                            <Logout/>
                        </Route>
                    </Switch>
                    <footer>
                        Application Developed By Erik Ciceraro
                    </footer>
                </div>
            </Router>
        )
    }
}

export default App;
